import '../register.css'

const Success = () => {

    return(
        <div>
            <header>
                <h2>AeroParker</h2>
                </header>
            <div className='successDiv'>
                <h2>Successfully Registered</h2>
                <h4>You should receive a email confirming your registration</h4>
                <p>You can now close this window</p>
            </div>
        </div>
    )
}
export default Success;
